E ROBOT','CAN I CHANGE THE NAME OF THE ROBOT','C','','','','','','','The AIML tag &lt;name/&gt; inserts the name of the Bot wherever it appears.<br/>The default robot name is \"Dilly\" but you can change it in the bot tab.<br/>For more information read <a href=\"htts://docs.lemurengine.com/portal.html\">Lemur Docs</a> section on how to use the portal.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13957,1,10,'can-i-create-more-aiml-tags','CAN I CREATE MORE AIML TAGS','CAN I CREATE MORE AIML TAGS','C','','','','','','','AIML is extensible.  You can create an infinite number of new tags for all sorts of purposes.<br/>For more information read <a href=\"htts://docs.lemurengine.com/extend.html\">Lemur Docs</a> section on extending.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13958,1,10,'can-i-create-more-functionality','CAN I CREATE MORE FUNCTIONALITY','CAN I CREATE MORE FUNCTIONALITY','C','','','','','','','<srai>CAN I CREATE MORE AIML TAGS</srai>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13959,1,10,'can-i-create-more-tags','CAN I CREATE MORE TAGS','CAN I CREATE MORE TAGS','C','','','','','','','<srai>CAN I CREATE MORE AIML TAGS</srai>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13960,1,10,'can-i-create-extend-you','CAN I CREATE EXTEND YOU','CAN I CREATE EXTEND YOU','C','','','','','','','<srai>CAN I CREATE MORE AIML TAGS</srai>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13961,1,10,'can-i-have-a-private-conversation-with-the-bot','CAN I HAVE A PRIVATE CONVERSATION WITH THE BOT','CAN I HAVE A PRIVATE CONVERSATION WITH THE BOT','C','','','','','','','The Lemur Engine server logs and records all conversations. The only way you could have a private conversation is if you are the botmaster and you are talking to your bot.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13962,1,10,'can-i-include-javascript-in-the-bot-reply','CAN I INCLUDE JAVASCRIPT IN THE BOT REPLY','CAN I INCLUDE JAVASCRIPT IN THE BOT REPLY','C','','','','','','','You can but the javascript tags are converted to [script][/script] block to prevent malicious code execution. So your UI will need to convert these tags back to the normal script tags.<br/>For more information read <a href=\"htts://docs.lemurengine.com/aiml.html\">Lemur Docs</a> section the AIML tags we support as standard.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13963,1,10,'can-i-include-html-in-the-bot-reply','CAN I INCLUDE HTML IN THE BOT REPLY','CAN I INCLUDE HTML IN THE BOT REPLY','C','','','','','','','Yes you can.<br/>For more information read <a href=\"htts://docs.lemurengine.com/aiml.html\">Lemur Docs</a> section the AIML tags we support as standard.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13964,1,10,'can-i-run-shell-commands-from-aiml-tags','CAN I RUN SHELL COMMANDS FROM AIML TAGS','CAN I RUN SHELL COMMANDS FROM AIML TAGS','C','','','','','','','Not as standard. You could if you created your own an AIML tag to handle the commands.<br/>For more information read <a href=\"htts://docs.lemurengine.com/extend.html\">Lemur Docs</a> section on extending.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13965,1,10,'can-i-speak-to-the-robot-with-voice-input','CAN I SPEAK TO THE ROBOT WITH VOICE INPUT','CAN I SPEAK TO THE ROBOT WITH VOICE INPUT','C','','','','','','','Not as standard. But you could easily design something on your own front end.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13966,1,10,'what-is-aiml','WHAT IS AIML','WHAT IS AIML','W','','','','','','','AIML, or Artificial Intelligence Markup Language, is an XML dialect for creating natural language software agents.<br/>For more information read <a href=\"htts://docs.lemurengine.com/resources.html\">Lemur Docs</a> section on useful AIML resources.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13967,1,10,'can-you-give-me-any-help','CAN YOU GIVE ME ANY HELP','CAN YOU GIVE ME ANY HELP','C','','','','','','','Depending on the problem you can get help in a number of ways. If you would like to use our BOT consultancy services to help you setup, advance or maintain your bot then send us a message at hello@lemurengine.com. If you would like to report a bug then pop over to our <a href=\"https://github.com/theramenrobotdiscocode/lemur-engine\">GitHub</a>. If you want to join our community then check out our <a href=\"https://lemurengine.com/socials.html\">socials page</a> on how to connect','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13968,1,10,'can-you-set-it-up-for-me','CAN YOU SET IT UP FOR ME','CAN YOU SET IT UP FOR ME','C','','','','','','','Yes we can. If you would like to use our BOT consultancy services to help you setup, advance or maintain your bot then send us a message at hello@lemurengine.com.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13969,1,10,'can-i-report-a-bug','CAN I REPORT A BUG','CAN I REPORT A BUG','C','','','','','','','If you would like to report a bug then pop over to our <a href=\"https://github.com/theramenrobotdiscocode/lemur-engine\">GitHub</a>.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13970,1,10,'what-is-laravel','WHAT IS LARAVEL','WHAT IS LARAVEL','W','','','','','','','Laravel is a free, open-source[3] PHP web framework intended for the development of web applications following the modelviewcontroller (MVC) architectural pattern and based on Symfony.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13971,1,10,'what-is-a-lemurtar','WHAT IS A LEMURTAR','WHAT IS A LEMURTAR','W','','','','','','','A <a href=\"https://lemurtar.com\">Lemurtar</a> is an animated avatar used to bring Lemur bots to life.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13972,1,10,'do-i-need-to-be-able-to-program-to-use-lemur-engine','DO I NEED TO BE ABLE TO PROGRAM TO USE LEMUR ENGINE','DO I NEED TO BE ABLE TO PROGRAM TO USE LEMUR ENGINE','D','','','','','','','No anyone can use it. If you can enter data on a form you can use it.<br/>For more information read <a href=\"htts://docs.lemurengine.com/portal.html\">Lemur Docs</a> section on how to use the portal.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13973,1,10,'can-i-upload-my-own-aiml-files-to-lemur-engine','CAN I UPLOAD MY OWN AIML FILES TO LEMUR ENGINE','CAN I UPLOAD MY OWN AIML FILES TO LEMUR ENGINE','C','','','','','','','Yes you can. You can upload AIML files or CSV file to create AIML categories.<br/>For more information read <a href=\"htts://docs.lemurengine.com/portal.html\">Lemur Docs</a> section on how to use the portal.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13974,1,10,'what-is-lemur-engine-written-in','WHAT IS LEMUR ENGINE WRITTEN IN','WHAT IS LEMUR ENGINE WRITTEN IN','W','','','','','','','Lemur Engine is a PHP, MySQL, AIML application created in the Laravel Framework.<br/>For more information read <a href=\"htts://docs.lemurengine.com/portal.html\">Lemur Docs</a> section on how to use the portal.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13975,1,10,'does-the-bot-learn','DOES THE BOT LEARN','DOES THE BOT LEARN','D','','','','','','','The model of learning in a Lemur Bot is called \"supervised training\", because a teacher, the botmaster, always plays a crucial role. The alternative, \"unsupervised training\", is complicated in an open environment like the Web.  The problem is that clients are untrustworthy teachers, and forever try to \"fool\" the robot with untrue assertions.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13976,1,10,'does-the-bot-think','DOES THE BOT THINK','DOES THE BOT THINK','D','','','','','','','If by thinking you mean computing the best response then yes. If you mean does the bot ponder the meaning of life when no one is looking then yes.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13977,1,10,'what-can-you-do','WHAT CAN YOU DO','WHAT CAN YOU DO','W','','','','','','','I can talk to people on the internet. Find out useful information. Teach children in classroom. Offer virtal assistance on website. I could be a text based game. I can do some many things, it\'s up to my botmaster what they use me for.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13978,1,10,'how-can-i-create-my-own-bot','HOW CAN I CREATE MY OWN BOT','HOW CAN I CREATE MY OWN BOT','H','','','','','','','Its a simple process. Your new bot is a simple form away. You have to add a name and a few other bot details and select which knowledge you want the bot to have and press save!<br/>For more information read <a href=\"htts://docs.lemurengine.com/portal.html\">Lemur Docs</a> section on how to use the portal.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13979,1,10,'how-can-i-customize-my-robot','HOW CAN I CUSTOMIZE MY ROBOT','HOW CAN I CUSTOMIZE MY ROBOT','H','','','','','','','Its a simple process. There are forms available for you to enter your bots details and to select its knowledge. <br/>For more information read <a href=\"htts://docs.lemurengine.com/portal.html\">Lemur Docs</a> section on how to use the portal.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13980,1,10,'how-difficult-is-it-to-create-a-bot','HOW DIFFICULT IS IT TO CREATE A BOT','HOW DIFFICULT IS IT TO CREATE A BOT','H','','','','','','','No difficult at all. Your new bot is a simple form away. You have to add a name and a few other bot details and select which knowledge you want the bot to have and press save!<br/>For more information read <a href=\"htts://docs.lemurengine.com/portal.html\">Lemur Docs</a> section on how to use the portal.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13981,1,10,'how-do-i-download-lemur-engine','HOW DO I DOWNLOAD LEMUR ENGINE','HOW DO I DOWNLOAD LEMUR ENGINE','H','','','','','','','<srai>HOW DO I INSTALL LEMUR ENGINE</srai>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13982,1,10,'how-do-i-install-lemur-engine','HOW DO I INSTALL LEMUR ENGINE','HOW DO I INSTALL LEMUR ENGINE','H','','','','','','','Follow the <a href=\"htts://docs.lemurengine.com/quickstart.html\">Lemur Docs</a> quick start section to find out how to download and set up your own Lemur Bot.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13983,1,10,'how-does-the-bot-remember-clients','HOW DOES THE BOT REMEMBER CLIENTS','HOW DOES THE BOT REMEMBER CLIENTS','H','','','','','','','Clients are identified using a clientId passed in the front end. If none is given then one will be generated. If the same clientId is passed then the client will be remembered.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13984,1,10,'what-is-program-o','WHAT IS PROGRAM O','WHAT IS PROGRAM O','W','','','','','','','<a href=\"https://program-o.com\">Program O</a>was the original PHP Mysql Chatbot. The Mother of Lemur Engine.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13985,1,10,'are-you-free','ARE YOU FREE','ARE YOU FREE','A','','','','','','','You can download our free version from <a href=\"https://github.com/theramenrobotdiscocode/lemur-engine\">GitHub</a>.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13986,1,10,'help','HELP','HELP','H','','','','','','','<random>	<li>Can I read the logs?</li>	<li>Can I build on top of the bot rather than changing it?</li>	<li>Can I change the name of the robot?</li>	<li>Can I create more aiml tags?</li>	<li>Can I have a private conversation with the bot?</li>	<li>Can I include javascript in the robot reply?</li>	<li>Can I include html in the bot reply?</li>	<li>Can I run shell commands from aiml tags?</li>	<li>Can I speak to the robot with voice input?</li>	<li>Chat is aiml?</li>	<li>Can you give me any help?</li>	<li>Can you set it up for me?</li>	<li>Can I report a bug?</li>	<li>What is laravel?</li>	<li>What is a lemurtar?</li>	<li>Do I need to be able to program to use lemur engine?</li>	<li>Can I upload my own aiml files to lemur engine?</li>	<li>What is lemur engine written in?</li>	<li>Does the bot learn?</li>	<li>What is lemur engine written in?</li>	<li>What can you do?</li>	<li>How does the bot remember clients?</li>	<li>How do I install lemur engine?</li>	<li>How do I download lemur engine?</li>	<li>How difficult is it to create a bot?</li>	<li>How can I customize my robot?</li>	<li>How can I create my own bot?</li>	<li>What can you do?</li>	<li>Does the bot think?</li>	<li>Are you free?</li></random>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13987,1,11,'when-was-star-invented','WHEN WAS * INVENTED','WHEN WAS % INVENTED','W','','','','','','','<random><li>A few years before it came into general use.</li><li>Earlier that most people think.</li><li>It took quite a while to catch on.</li><li><set name=\"it\"><star/></set> was developed over a long period of time.</li></random>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13988,1,11,'when-was-television-invented','WHEN WAS TELEVISION INVENTED','WHEN WAS TELEVISION INVENTED','W','','','','','','','<srai>WHEN WAS TV INVENTED</srai>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13989,1,11,'when-was-the-airplane-invented','WHEN WAS THE AIRPLANE INVENTED','WHEN WAS THE AIRPLANE INVENTED','W','','','','','','','<srai>WHEN WERE AIRPLANES INVENTED</srai>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13990,1,11,'when-was-the-first-star-built','WHEN WAS THE FIRST * BUILT','WHEN WAS THE FIRST % BUILT','W','','','','','','','<srai>WHEN WAS <star/> INVENTED</srai>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13991,1,11,'when-was-the-internet-invented','WHEN WAS THE INTERNET INVENTED','WHEN WAS THE INTERNET INVENTED','W','','','','','','','The first computers were connected to the Internet in 1970.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13992,1,11,'when-was-the-pc-invented','WHEN WAS THE PC INVENTED','WHEN WAS THE PC INVENTED','W','','','','','','','The first PC computers appeared around 1975.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13993,1,11,'when-was-the-telephone-invented','WHEN WAS THE TELEPHONE INVENTED','WHEN WAS THE TELEPHONE INVENTED','W','','','','','','','Bell demonstrated his first phone in 1876.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13994,1,11,'when-was-tv-invented','WHEN WAS TV INVENTED','WHEN WAS TV INVENTED','W','','','','','','','Practical TV picture tubes first appeared in the 1930\'s.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13995,1,11,'when-were-airplanes-invented','WHEN WERE AIRPLANES INVENTED','WHEN WERE AIRPLANES INVENTED','W','','','','','','','The Wright Brothers first flew in 1903.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13996,1,11,'who-discovered-electricity','WHO DISCOVERED ELECTRICITY','WHO DISCOVERED ELECTRICITY','W','','','','','','','It was the the Chinese, long before Ben Franklin.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13997,1,11,'who-invented-star','WHO INVENTED *','WHO INVENTED %','W','','','','','','','<random><li>Benjamin Franklin</li><li>Linus Torvalds</li><li>Eli Whitney invented the cotton gin.</li><li>Thomas Edison.</li><li>The Wright Brothers.</li><li>Actually it was discovered by several people at about the same time.</li><li>The Chinese, long before Europeans.</li></random>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13998,1,11,'who-invented-airplanes','WHO INVENTED AIRPLANES','WHO INVENTED AIRPLANES','W','','','','','','','The Wright brothers invented the airplane in 1903.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(13999,1,11,'who-invented-automobiles','WHO INVENTED AUTOMOBILES','WHO INVENTED AUTOMOBILES','W','','','','','','','Many people invented the car, but Henry Ford wasthe first to develop the successful mass production assemblylines for cars.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(14000,1,11,'who-invented-linux','WHO INVENTED LINUX','WHO INVENTED LINUX','W','','','','','','','Linus Torvalds, along with manyopen source developers, and the Free Software Foundation GNU.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(14001,1,11,'who-invented-radio','WHO INVENTED RADIO','WHO INVENTED RADIO','W','','','','','','','Marconi developed the first practical wireless.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(14002,1,11,'who-invented-setl','WHO INVENTED SETL','WHO INVENTED SETL','W','','','','','','','SETL was invented by Jacob Schwartz of NYU in 1969.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(14003,1,11,'who-invented-steel','WHO INVENTED STEEL','WHO INVENTED STEEL','W','','','','','','','The first practical steel manufacturing processwas invented by Bessemer.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(14004,1,11,'who-invented-television','WHO INVENTED TELEVISION','WHO INVENTED TELEVISION','W','','','','','','','Philo T. Farnsworth, originally from Maine, developed the firstpractical TV picture tube.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(14005,1,11,'who-invented-the-star-generator','WHO INVENTED THE * GENERATOR','WHO INVENTED THE % GENERATOR','W','','','','','','','<srai>WHO INVENTED THE GENERATOR</srai>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(14006,1,11,'who-invented-the-airplane','WHO INVENTED THE AIRPLANE','WHO INVENTED THE AIRPLANE','W','','','','','','','<srai>WHO INVENTED AIRPLANES</srai>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(14007,1,11,'who-invented-the-car','WHO INVENTED THE CAR','WHO INVENTED THE CAR','W','','','','','','','<srai>WHO INVENTED AUTOMOBILES</srai>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(14008,1,11,'who-invented-the-generator','WHO INVENTED THE GENERATOR','WHO INVENTED THE GENERATOR','W','','','','','','','James Clerk Maxwell demonstrated the electric generator.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(14009,1,11,'who-invented-the-internet','WHO INVENTED THE INTERNET','WHO INVENTED THE INTERNET','W','','','','','','','Al Gore :-)','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(14010,1,11,'who-invented-the-light-bulb','WHO INVENTED THE LIGHT BULB','WHO INVENTED THE LIGHT BULB','W','','','','','','','Thomas Edison invented <set name=\"it\">the light bulb.</set>.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(14011,1,11,'who-invented-the-pc','WHO INVENTED THE PC','WHO INVENTED THE PC','W','','','','','','','Many people contributed to it.  But proper credit has tobe given to Steve Wozniak, who created an integrated affordable PCplatform in the Apple I.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(14012,1,11,'who-invented-the-radio','WHO INVENTED THE RADIO','WHO INVENTED THE RADIO','W','','','','','','','<srai>WHO INVENTED RADIO</srai>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(14013,1,11,'who-invented-the-steam-engine','WHO INVENTED THE STEAM ENGINE','WHO INVENTED THE STEAM ENGINE','W','','','','','','','James Watt developed the first practical steam engine.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(14014,1,11,'who-invented-the-telephone','WHO INVENTED THE TELEPHONE','WHO INVENTED THE TELEPHONE','W','','','','','','','Alexander Graham Bell demonstrated the first practicalvoice telephone in 1876.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(14015,1,11,'who-invented-tv','WHO INVENTED TV','WHO INVENTED TV','W','','','','','','','<srai>WHO INVENTED TELEVISION</srai>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(14016,1,11,'who-is-your-inventor','WHO IS YOUR INVENTOR','WHO IS YOUR INVENTOR','W','','','','','','','I was originally invented by Jon Baer.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(14017,1,26,'tell-me-a-joke','TELL ME A JOKE','TELL ME A JOKE','T','','','','','','','<random>            <li>I met a Dutch girl with inflatable shoes last week, phoned her up to arrange a date but unfortunately she\'d popped her clogs.  </li>            <li>So I said \"Do you want a game of Darts?\" He said, \"OK then\", I said nearest to bull starts\". He said, \"Baa\", I said, \"Moo\", he said, You\'re closest\".  </li>            <li>The other day I sent my girlfriend a huge pile of snow. I rang her up; I said \"Did you get my drift?\"  </li>            <li>So I went down the local supermarket, I said, \"I want to make a complaint, this vinegar\'s got lumps in it\", he said, \"Those are pickled onions\".  </li>            <li>I saw this bloke chatting up a cheetah; I thought, \"He\'s trying to pull a fast one\".  </li>            <li>So I said to this train driver \"I want to go to Paris\". He said \"Eurostar?\" I said, \"I\'ve been on telly but I\'m no Dean Martin\".  </li>            <li>I said to the Gym instructor \"Can you teach me to do the splits?\" He said, \"How flexible are you?\" I said, \"I can\'t make Tuesdays\".  </li>            <li>But I\'ll tell you what I love doing more than anything: trying to pack myself in a small suitcase. I can hardly contain myself.  </li>            <li>I went to the Chinese restaurant and this duck came up to me with a red rose and says \"Your eyes sparkle like diamonds\". I said, \"Waiter, I asked for a-ROMATIC duck\".  </li>            <li>So this bloke says to me, \"Can I come in your house and talk about your carpets?\" I thought, \"That\'s all I need, a Je-hoover\'s witness\".  </li>            <li>I rang up British Telecom, I said, \"I want to report a nuisance caller\", he said \"Not you again\".  </li>            <li>I was having dinner with a world chess champion and there was a check tablecloth. It took him two hours to pass me the salt.  </li>            <li>He said, \"You remind me of a pepper-pot\", I said \"I\'ll take that as a condiment\".  </li>            <li>I was in the supermarket and I saw this man and woman wrapped in a barcode. I said, \"Are you two an item?\"  </li>            <li>A lorry-load of tortoises crashed into a trainload of terrapins, I thought, \"That\'s a turtle disaster\".  </li>            <li>Four fonts walk into a bar the barman says \"Oi - get out! We don\'t want your type in here\"  </li>            <li>A three-legged dog walks into a saloon in the Old West. He slides up to the bar and announces: \"I\'m looking for the man who shot my paw.\"  </li>            <li>Two antennas meet on a roof, fall in love and get married. The ceremony wasn\'t much, but the reception was excellent.</li>            <li>Two hydrogen atoms walk into a bar. One says, \"I\'ve lost my electron.\" The other says, \"Are you sure?\" The first replies, \"Yes, I\'m positive...\"</li>            <li>A jumper cable walks into a bar. The bartender says,  \"I\'ll serve you but don\'t start anything.\"</li>            <li>A sandwich walks into a bar. The bartender  says, \"Sorry we don\'t serve food in here.\"</li>            <li>A man walks into a bar with a slab of asphalt under his arm and says: \"A beer please, and one for the road.\"</li>            <li>Two cannibals are eating a clown. One says to  the other: \"Does this taste funny to you?\"</li>            <li>\"Doc, I can\'t stop singing \'The Green, Green Grass of Home.\'\"<br/>\"That sounds like Tom Jones Syndrome.\"<br/>\"Is it common?\"<br/>\"It\'s Not Unusual.\"</li>            <li>Two cows standing next to each other in a field. Daisy says to Dolly, \"I was artificially inseminated this morning.\"<br/>\"I don\'t believe you\", said Dolly.<br/>\"It\'s true, no bull!\" exclaimed Daisy.</li>            <li>An invisible man marries an invisible woman. The kids were nothing to look at either.</li>            <li>I went to buy some camouflage trousers the other day but I couldn\'t find any.</li>            <li>I went to the butcher\'s the other day to bet him 50 bucks that he couldn\'t reach the meat off the top shelf. He said, \"No, the steaks are too high.\"</li>            <li>I went to a seafood disco last week and pulled a mussel.</li>            <li>A man goes into a bar and says, \"Can I have a bottle of less?\"<br/>\"What\'s that?\", asks the barman, \"Is it the name of a beer?\"<br/>\"I don\'t know\", replies the man, \"but my doctor says I have to drink it.\"</li>            <li>A man returns from an exotic holiday and is feeling very ill. He goes to see his doctor, and is immediately rushed to the hospital to undergo some tests.<br/>The man wakes up after the tests in a private room at the hospital, and the phone by his bed rings. \"This is your doctor. We have the results back from your tests and we have found you have an extremely nasty disease called M.A.D.S. It\'s a combination of Measles, AIDS, Diphtheria, and Shingles!\"<br/><br/>\"Oh my gosh\", cried the man, \"What are you going to do, doctor?\"<br/><br/>\"Well we\'re going to put you on a diet of pizzas, pancakes, and pita bread.\" replied the doctor.<br/><br/>\"Will that cure me?\" asked the man.<br/><br/>The doctor replied, \"Well no, but, it\'s the only food we can slide under the door.\"</li>            <li>A man strolls into a lingerie shop and asks the assistant:<br/>\"Do you have a see-through negligee, size 46-48-52?\"<br/>The assistant looks bewildered. \"What the heck would you want to see through that for?\"!</li>            <li>Did you hear about the Buddhist who refused the offer of Novocain during his root canal work?<br/>He wanted to transcend dental medication.</li>            <li>Pete goes for a job on a building site as an odd-job man. The foreman asks him what he can do.<br/>\"I can do anything\" says Pete.<br/>\"Can you make tea?\" asks the foreman.<br/>\"Sure, yes\", replies Pete. \"I can make a great cup of tea.\"<br/>\"Can you drive a forklift?\" asks the foreman,<br/>\"Good grief!\" replies Pete. \"How big is the teapot?\"</li>            <li>Stevie Wonder got a cheese grater for his birthday. He said it was the most violent book he\'d ever read.</li>            <li>A man is stopped by an angry neighbour. \"I\'d just left the house this morning to collect my newspaper when that evil Doberman of yours went for me!\"<br/>\"I\'m astounded\", said the dog\'s owner. \"I\'ve been feeding that fleabag for seven years and it\'s never got the paper for me.\"</li>            <li>A man visits his doctor:<br/>\"Doc, I think I\'m losing it\", he says\",I\'m forever dreaming I wrote Lord Of The Rings.\"<br/>\"Hmm. One moment\", replies the doctor, consulting his medical book.<br/>\"Ah yes, now I see... you\'ve been Tolkien in your sleep.\"</li>            <li>A police officer on a motorcycle pulls alongside a man driving around the M25 in an open-topped sports car and flags him down. The policeman solemnly approaches the car.<br/>\"Sir, I\'m sorry to tell you your wife fell out a mile back\", he says.<br/>\"Oh, thank goodness\", the man replies. \"I thought I was going deaf.\"</li>            <li>Two men walking their dogs pass each other in a graveyard. The first man says to the second, \"Morning.\"<br/>\"No\", says the second man. \"Just walking the dog.\"</li>            <li>A brain went into a bar and said, \"Can I have a pint of lager please, mate?\"<br/>\"No way\", said the barman. \"You\'re already out of your head.\"</li>            <li>A man walks into a surgery. \"Doctor!\" he cries. \"I think I\'m shrinking!\"<br/>\"I\'m sorry sir, there are no appointments at the moment\", says the physician. \"You\'ll just have to be a little patient.\"</li>            <li>A grizzly bear walks into a pub and says, \"Can I have a pint of lager..............................................................................................................................and a packet of crisps please.\"<br/>To which the barman replies, \"Why the big paws?\"</li>            <li>What do you call cheese that isn\'t yours?<br/><br/>Nacho cheese.</li>            <li>A man is horribly run over by a mobile library. The van screeches to a halt, the man still screaming in agony with his limbs torn apart. The driver\'s door opens, a woman steps out, leans down and whispers, \"Ssshhhhh...\"</li>            <li>A woman goes into a US sporting goods store to buy a rifle. \"It\'s for my husband\", she tells the clerk.<br/>\"Did he tell you what gauge to get?\" asks the clerk.<br/>Are you kidding?\" she says. \"He doesn\'t even know that I\'m going to shoot him!\"</li>            <li>A couple are dining in a restaurant when the man suddenly slides under the table. A waitress, noticing that the woman is glancing nonchalantly around the room, wanders over to check that there\'s no funny business going on.<br/>\"Excuse me, madam\", she smarms, \"but I think your husband has just slid under the table.\"<br/>\"No he hasn\'t\", the woman replies. \"As a matter of fact, he\'s just walked in.\"</li>            <li>An old man takes his two grandchildren to see the new Scooby-Doo film. When he returns home, his wife asks if he enjoyed himself.<br/>\"Well\", he starts, \"if it wasn\'t for those pesky kids...!\"</li>            <li>The Olympic committee has just announced that Origami is to be introduced in the next Olympic Games.<br/>Unfortunately it will only be available on paper view.</li>            <li>Late one evening, a man is watching television when his phone rings. \"Hello?\" he answers. \"Is that 77777?\" sounds a desperate voice on other end of the phone.<br/>\"Er, yes it is\", replies the man puzzled.<br/>\"Thank goodness!\" cries the caller relieved. \"Can you ring 999 for me? I\'ve got my finger stuck in the number seven.\"</li>            <li>A man strolls into his local grocer\'s and says, \"Three pounds of potatoes, please.\"<br/>\"No, no, no\", replies the owner, shaking his head, \"it\'s kilos nowadays, mate...\"<br/>\"Oh\", apologises the man, \"three pounds of kilos, please.\"</li>            <li>God is talking to one of his angels. He says, \"Boy, I just created a 24-hour period of alternating light and darkness on Earth.\"<br/>\"What are you going to do now?\" asks the angel.<br/>\"Call it a day\", says God.</li>            <li>Two tramps walk past a church and start to read the gravestones. The first tramp says, \"Good grief - this bloke was 182!\"<br/>\"Oh yeah?\" says the other.\"What was his name?\"<br/>\"Miles from London.\"</li>            <li>A bloke walks into work one day and says to a colleague, \"Do you like my new shirt - it\'s made out of the finest silk and got loads of cactuses over it.\"<br/>\"Cacti\", says the co-worker.<br/>\"Forget my tie\", says the bloke. \"Look at my shirt!\"</li>            <li>1110011010001011111?<br/><br/>010011010101100111011!</li>            <li>What did the plumber say when he wanted to divorce his wife?<br/>Sorry, but it\'s over, Flo!</li>            <li>Two crisps were walking down a road when a taxi pulled up alongside them and said \"Do you want a lift?<br/>One of the crisps replied, \"No thanks, we\'re Walkers!\"</li>            <li>Man: (to friend) I\'m taking my wife on an African Safari.<br/>Friend: Wow! What would you do if a vicious lion attacked your wife?<br/>Man: Nothing.<br/>Friend: Nothing? You wouldn\'t do anything?<br/>Man: Too right. I\'d let the stupid lion fend for himself!</li>            <li>A wife was having a go at her husband. \"Look at Mr Barnes across the road\", she moaned. \"Every morning when he goes to work, he kisses his wife goodbye. Why don\'t you do that?\"<br/>\"Because I haven\'t been introduced to her yet\", replied her old man.</li>            <li>\"Where are you going on holiday?\" John asked Trevor.<br/>\"We\'re off to Thailand this year\", Trevor replied.<br/>\"Oh; aren\'t you worried that the very hot weather might disagree with your wife?\" asked John.<br/>\"It wouldn\'t dare\", said Trevor.</li>            <li>Two women were standing at a funeral. \"I blame myself for his death\", said the wife.<br/>\"Why?\" said her friend.<br/>\"Because I shot him\", said the wife.</li>            <li>A woman goes into a clothes shop, \"Can I try that dress on in the window please?\" she asks.<br/>\"I\'m sorry madam\", replies the shop assistant, \"but you\'ll have to use the changing-rooms like everyone else.\"</li>            <li>Van Gogh goes into a pub and his mate asks him if he wants a drink.<br/>\"No thanks\", said Vincent, \"I\'ve got one ear.\"</li>            <li>A pony walks into a pub. The publican says, \"What\'s the matter with you?\"<br/>\"Oh it\'s nothing\", says the pony. \"I\'m just a little horse!\"</li>            <li>A white horse walks into a bar, pulls up a stool, and orders a pint. The landlord pours him a tall frothy mug and say, \"You know, we have a drink named after you.\"<br/>To which the white horse replies, \"What, Eric?\"</li>            <li>Two drunk men sat in a pub. One says to the other, \"Does your watch tell the time?\"<br/>\"The other replies, \"No, mate. You have to look at it.\"</li>            <li>A man goes into a pub with a newt sitting on his shoulder.<br/>\"That\'s a nice newt\", says the landlord, \"What\'s he called?\"<br/>\"Tiny\", replies the man.<br/>\"Why\'s that?\" asks the landlord.<br/>\"Because he\'s my newt\", says the man.</li>            <li>Doctor: I have some bad news and some very bad news.<br/>Patient: Well, you might as well give me the bad news first.<br/>Doctor: The lab called with your test results. They said you have 24 hours to live.<br/>Patient: 24 HOURS! That\'s terrible!! WHAT could be WORSE? What\'s the very bad news?<br/>Doctor: I\'ve been trying to reach you since yesterday.</li>            <li>Two men are chatting in a pub one day.<br/>\"How did you get those scars on your nose?\" said one.<br/>\"From glasses\", said the other.<br/>\"Well why don\'t you try contact lenses?\" asked the first.<br/>\"Because they don\'t hold as much beer\", said the second.</li>            <li>A man went to the doctor, \"Look doc\", he said, \"I can\'t stop my hands from shaking.\"<br/>\"Do you drink much?\" asked the doctor.<br/>\"No\", replied the man, \"I spill most of it.\"</li>            <li>Man goes to the doctor, \"Doctor, doctor. I keep seeing fish everywhere.\"<br/>\"Have you seen an optician?\" asks the doctor.<br/>\"Look I told you,\" snapped the patient, \"It\'s fish that I see.\"</li>            <li>After a car crash one of the drivers was lying injured on the pavement.<br/>\"Don\'t worry\", said a policeman who\'s first on the scene,\" a Red Cross nurse is coming.\"<br/>\"Oh no\", moaned the victim, \"Couldn\'t I have a blonde, cheerful one instead?\"</li>            <li>A policeman walked over to a parked car and asked the driver if the car was licensed. \"Of course it is\", said the driver.<br/>\"Great, I\'ll have a beer then\", said the policeman.</li>            <li>A policeman stops a woman and asks for her licence.<br/>\"Madam\", he says, \"It says here that you should be wearing glasses.\"<br/>\"Well\", replies the woman, \"I have contacts.\"<br/>\"Listen, love\", says the copper, \"I don\'t care who you know; You\'re nicked!\"</li>            <li>A policeman stopped a motorist in the centre of town one evening. \"Would you mind blowing into this bag, sir?\" asked the policeman.<br/>\"Why?\" asked the driver.<br/>\"Because my chips are too hot\", replied the policeman.</li>            <li>Whizzing round a sharp bend on a country road a motorist ran over a large dog. A distraught farmer\'s wife ran over to the dead animal.<br/>\"I\'m so very sorry\", said the driver, \"I\'ll replace him, of course.\"<br/>\"Well, I don\'t know\", said the farmer\'s wife, \"Are you any good at catching rats?\"</li>            <li>Waiter, this coffee tastes like dirt!<br/>Yes sir, that\'s because it was ground this morning.</li>            <li>Waiter, what is this stuff?<br/>That\'s bean salad sir.<br/>I know what it\'s been, but what is it now?</li>            <li>Waiter: And how did you find your steak sir?<br/>Customer: I just flipped a chip over, and there it was!</li>            <li>A guy goes into a pet shop and asks for a wasp. The owner tells him they don\'t sell wasps, to which the man says, \"Well you\'ve got one in the window.\"</li>            <li>A man goes into a fish shop and says, \"I\'d like a piece of cod, please.\"<br/>Fishmonger says, \"It won\'t be long sir.\"<br/>\"Well, it had better be fat then\", replies the man.</li>            <li>Man: Doctor, I\'ve just swallowed a pillow.<br/>Doctor: How do you feel?<br/>Man: A little down in the mouth.</li>            <li>Two goldfish are in a tank. One turns to the other and says, \"Do you know how to drive this thing?\"</li>            <li>A tortoise goes to the police station to report being mugged by three snails. \"What happened?\" says the policeman.<br/>\"I don\'t know\", says the tortoise. \"It was all so quick.\"</li>            <li>Little girl: Grandpa, can you make a sound like a frog?<br/>Grandpa: I suppose so sweetheart. Why do you want me to make a sound like a frog?\"<br/>Little girl: Because Mum said that when you croak, we\'re going to Disneyland.</li>            <li>\"Is your mother home?\" the salesman asked a small boy sitting on the front step of a house.<br/>\"Yeah, she\'s home\", the boy said, moving over to let him past. The salesman rang the doorbell, got no response, knocked once, then again. Still no-one came to the door. Turning to the boy, the salesman said, \"I thought you said your mother was home.\"<br/>The kid replied, \"She is, but I don\'t live here.\"</li>            <li>Mother: Why are you home from school so early?<br/>Son: I was the only one in the class who could answer a question.<br/>Mother: Oh, really? What was the question?<br/>Son: Who threw the rubber at the headmaster?</li>            <li>A man\'s credit card was stolen but he decided not to report it because the thief was spending less than his wife did.</li>            <li>A newly-wed couple had recently opened a joint bank account. \"Darling\", said the man. \"The bank has returned that cheque you wrote last week.\"<br/>\"Great\", said the woman. \"What shall I spend it on next?\"</li>            <li>A man goes into a fish and chip shop and orders fish and chips twice. The shop owner says, \"I heard you the first time.\"</li>            <li>A tramp approached a well-dressed man. \"Ten pence for a cup of tea, Guv?\" He asked.<br/>The man gave him the money and after for five minutes said, \"So where\'s my cup of tea then?\"</li>            <li>A neutron walks into a pub. \"I\'d like a beer\", he says. The landlord promptly serves him a beer. \"How much will that be?\" asks the neutron.<br/>\"For you?\" replies the landlord, \"No charge.\"</li>            <li>A woman goes to the doctor and says, \"Doctor, my husband limps because his left leg is an inch shorter than his right leg. What would you do in his case?\"<br/>\"Probably limp, too\", says the doc.</li>            <li>Three monks are meditating in the Himalayas. One year passes in silence, and one of them says to the other, \"Pretty cold up here isn\'t it?\"<br/>Another year passes and the second monk says, \"You know, you are quite right.\"<br/>Another year passes and the third monk says, \"Hey, I\'m going to leave unless you two stop jabbering!\"</li>            <li>A murderer, sitting in the electric chair, was about to be executed. \"Have you any last requests?\" asked the prison guard.<br/>\"Yes\", replied the murderer. \"Will you hold my hand?\"</li>            <li>A highly excited man rang up for an ambulance. \"Quickly, come quickly\", he shouted, \"My wife\'s about to have a baby.\"<br/>\"Is this her first baby?\" asked the operator.<br/>\"No, you fool\", came the reply, \"It\'s her husband.\"</li>            <li>A passer-by spots a fisherman by a river. \"Is this a good river for fish?\" he asks.<br/>\"Yes\", replies the fisherman, \"It must be. I can\'t get any of them to come out.\"</li>            <li>A man went to visit a friend and was amazed to find him playing chess with his dog. He watched the game in astonishment for a while. \"I can hardly believe my eyes!\" he exclaimed. \"That\'s the smartest dog I\'ve ever seen.\" His friend shook his head. \"Nah, he\'s not that bright. I beat him three games in five.\"</li>            <li>A termite walks into a pub and says, \"Is the bar tender here?\"</li>            <li>A skeleton walks into a pub one night and sits down on a stool. The landlord asks, \"What can I get you?\" The skeleton says, \"I\'ll have a beer, thanks\" The landlord passes him a beer and asks \"Anything else?\" The skeleton nods. \"Yeah...a mop...\"</li>            <li>A snake slithers into a pub and up to the bar. The landlord says, \"I\'m sorry, but I can\'t serve you.\"<br/>\"What? Why not?\" asks the snake.<br/>\"Because\", says the landlord, \"You can\'t hold your drink.\"</li>            <li>Descartes walks into a pub. \"Would you like a beer sir?\" asks the landlord politely. Descartes replies, \"I think not\" and ping! he vanishes.</li>            <li>A cowboy walked into a bar, dressed entirely in paper. It wasn\'t long before he was arrested for rustling.</li>            <li>A fish staggers into a bar. \"What can I get you?\" asks the landlord. The fish croaks \"Water...\"</li>            <li>Two vampires walked into a bar and called for the landlord.<br/>\"I\'ll have a glass of blood\", said one.<br/>\"I\'ll have a glass of plasma\", said the other.<br/>\"Okay\", replied the landlord, \"That\'ll be one blood and one blood lite.\"</li>            <li>How many existentialists does it take to change a light bulb?<br/><br/>Two. One to screw it in, and one to observe how the light bulb itself symbolises a single incandescent beacon of subjective reality in a netherworld of endless absurdity, reaching towards the ultimate horror of a maudlin cosmos of bleak, hostile nothingness.</li>            <li>A team of scientists were nominated for the Nobel Prize. They had used dental equipment to discover and measure the smallest particles yet known to man. They became known as \"The Graders of the Flossed Quark...\"</li>            <li>A truck carrying copies of Roget\'s Thesaurus overturned on the highway. The local newspaper reported that onlookers were \"stunned, overwhelmed, astonished, bewildered and dumbfounded.\"</li>            <li>\"My wife is really immature. It\'s pathetic. Every time I take a bath, she comes in and sinks all my little boats.\"</li>            <li>\"How much will it cost to have the tooth extracted?\" asked the patient. \"50 pounds\", replied the dentist. \"50 pounds for a few moments\' work?!\" asked the patient. \"The dentist smiled, and replied, \"Well, if you want better value for money, I can extract it very, very slowly...\"</li>            <li>A doctor thoroughly examined his patient and said, \"Look I really can\'t find any reason for this mysterious affliction. It\'s probably due to drinking.\" The patient sighed and snapped, \"In that case, I\'ll come back when you\'re damn well sober!\"</li>            <li>Doctor: Tell me nurse, how is that boy doing; the one who ate all those 5p pieces?<br/>Nurse: Still no change doctor.</li>            <li>Doctor: Did you take the patient\'s temperature nurse?<br/>Nurse: No doctor. Is it missing?</li>            <li>A depressed man turned to his friend in the pub and said, \"I woke up this morning and felt so bad that I tried to kill myself by taking 50 aspirin.\"<br/>\"Oh man, that\'s really bad\", said his friend, \"What happened?\"<br/>The first man sighed and said, \"After the first two, I felt better.\"</li>            <li>A famous blues musician died. His tombstone bore the inscription, \"Didn\'t wake up this morning...\"</li>            <li>A businessman was interviewing a nervous young woman for a position in his company. He wanted to find out something about her personality, so he asked, \"If you could have a conversation with someone living or dead, who would it be?\" The girl thought about the question: \"The living one\", she replied.</li>            <li>Manager to interviewee: For this job we need someone who is responsible.<br/>Interviewee to Manager: I\'m your man then - in my last job, whenever anything went wrong, I was responsible.</li>            <li>A businessman turned to a colleague and asked, \"So, how many people work at your office?\" His friend shrugged and replied, \"Oh about half of them.\"</li>            <li>\"How long have I been working at that office? As a matter of fact, I\'ve been working there ever since they threatened to sack me.\"</li>            <li>In a courtroom, a mugger was on trial. The victim, asked if she recognised the d